import React from 'react'
import { View, StyleSheet, Text, Image, TouchableOpacity, TextInput } from 'react-native'


export const SignIn = props => {
    return (
        <View style={styles.container}>
            <Text style={styles.title}>Sign in</Text>
            <Text style={styles.title}>Username or email</Text>
        </View>
    )
}

const styles = StyleSheet.create ({
    container: {
        height: '100%',
        width: '100%'
    },
    title: {
        fontFamily: 'Roboto',
        fontStyle: 'normal',
        fontWeight: 'bold',
        fontSize: 32,
        lineHeight: 37,
        paddingLeft: 20,
        paddingTop: 66,
    },
    messLogin:{
        paddingLeft: 20,
        paddingTop: 113,
        fontFamily: 'Roboto',
        fontStyle: 'normal',
        fontWeight: 'normal',
        fontSize: 14,
        lineHeight: 20,
        color: '#57586E',
        opacity: 0.4,
    }
})
